style.css:
@-moz-document url-prefix("https://www.horsereality.com/horses/") {
.horse_photocon .horse_photo img.foal {
    max-width: 320px;
    max-height: 285px;
    margin-left: 170px;
    transform: scalex(-1);
}

.horse-item .image-dam-and-foal .horse-image:last-child {
    position: absolute;
    z-index: 4;
    top: unset;
    right: -10px;
    bottom: 0;
    transform-origin: unset;
    transform: scalex(-1);
}
}
